import { useMemo } from "react";
import PropTypes from "prop-types";
import styles from "./GroupComponent3.css";

const GroupComponent3 = ({
  className = "",
  frame,
  experiencedDoctor,
  propBorder,
}) => {
  const groupDivStyle = useMemo(() => {
    return {
      border: propBorder,
    };
  }, [propBorder]);

  return (
    <div
      className={[styles.frameParent, className].join(" ")}
      style={groupDivStyle}
    >
      <div className={styles.frameWrapper}>
        <img className={styles.frameIcon} loading="lazy" alt="" src={frame} />
      </div>
      <div className={styles.frameChild} />
      <div className={styles.frameGroup}>
        <div className={styles.experiencedDoctorWrapper}>
          <h3 className={styles.experiencedDoctor}>{experiencedDoctor}</h3>
        </div>
        <div className={styles.discoverComprehensiveHealth}>
          Discover comprehensive health care support services conveniently
          tailored to meet all your needs in one place.
        </div>
      </div>
    </div>
  );
};

GroupComponent3.propTypes = {
  className: PropTypes.string,
  frame: PropTypes.string,
  experiencedDoctor: PropTypes.string,

  /** Style props */
  propBorder: PropTypes.any,
};

export default GroupComponent3;
